import React from 'react';
import './SearchPage.css';

function SearchPage() {
    return (
        <div className="search__container">
            <h1 className="search__title">Что творится в мире?</h1>
            <p className="search__title">Что творится в мире?</p>
        </div>
    )
}

export default SearchPage;
